	void mySpritePushImage(TFT_eSprite &sprite, int16_t x, int16_t y, int16_t w, int16_t h, const uint16_t *img) {
	  // Récupère le pointeur vers le buffer interne du sprite
	  for (int16_t row = 0; row < h; row++) {
		for (int16_t col = 0; col < w; col++) {
		  // Récupère la couleur du pixel dans l'image source
		  uint16_t color = img[row * w + col];
		  // Dessine le pixel dans le buffer du sprite
		  sprite.drawPixel(x + col, y + row, color);
		}
	  }
	}

	void mySpritePushSprite(TFT_eSprite &sprite, int16_t x, int16_t y, int16_t w, int16_t h, const uint16_t *sprData) {
	  for (int16_t row = 0; row < h; row++) {
		for (int16_t col = 0; col < w; col++) {
		  uint16_t color = sprData[row * w + col];
		  if (color != 0xFFFF) {  // 0xFFFF représente le blanc (transparent)
			sprite.drawPixel(x + col, y + row, color);
		  }
		}
	  }
	}

