	void encoder_menu(int sens)
	{
		if(sens==-1 || sens==1)
		{
			if(menu_focus==0)
			{
			  currentGroup+=sens;
			  if(currentGroup<0) currentGroup=0;
			  if(currentGroup>maxGroup-1) currentGroup=maxGroup-1;
			  clear();
			  display_menu();
			  display();
			}
			if(menu_focus==1)
			{
			  currentScreen+=sens;
			  if(currentScreen<0) currentScreen=0;
			  if(currentScreen>maxScreens-1) currentScreen=maxScreens-1;
			  clear();
			  display_menu();
			  display();
			}
		}
		if(sens==2)
		{
			if(menu_focus==0)
			{
			  menu_focus=1;
			  clear();
			  display_menu();
			  display();
			}
		}
		if(sens==3)
		{
			if(menu_focus==1)
			{
			  menu_focus=0;
			  clear();
			  display_menu();
			  display();
			}
		}
	}
	
