	void display_menu()
	{
	  /************ 1. Lecture + parsing du JSON ****************/
	  //fs::File file = FFat.open("/screens.jso", FILE_READ);
	  //count_open++;
	  //if (!file) { Serial.println("Impossible d'ouvrir le fichier JSON !"); return; }

	  //const size_t size = file.size();
	  //if (size == 0)   { Serial.println("Fichier JSON vide !"); file.close(); count_open--; return; }
	  //Serial.print("count_open : ");
	  //Serial.println(count_open);
	  
	  size_t size;
	  uint32_t clus, off;
	  if (!fat_find_file(cfg, "SCREENS.JSO", clus, size, off)) {
		  Serial.println("Impossible d'ouvrir le fichier JSON !");
		return;
	  }
	  FlashFile file;
	  file.open(cfg.part, off, size);
	  size = file.size();
	  if (size == 0) {
		Serial.println("Fichier JSON vide !");
		return;
	  }

	  std::unique_ptr<char[]> buf(new char[size + 1]);
	  file.read(buf.get(), size);
	  buf[size] = '\0';
	  //file.close();
	  //count_open--;
	  //Serial.print("count_open : ");
	  //Serial.println(count_open);

	  DynamicJsonDocument doc(4096);          // → augmentez si nécessaire
	  DeserializationError err = deserializeJson(doc, buf.get());
	  if (err) { Serial.print("Erreur JSON : "); Serial.println(err.c_str()); return; }

	  JsonArray screens = doc["screens"].as<JsonArray>();
	  //if (screens.empty()) { Serial.println("Aucun écran défini !"); return; }


	  /************ 2. Regrouper les écrans par « group » ********/
	  struct GroupInfo {
		String                     name;
		std::vector<uint16_t>      idx;   // positions dans 'screens'
	  };
	  std::vector<GroupInfo> groups;

	  for (uint16_t i = 0; i < screens.size(); ++i) {
		JsonObject s  = screens[i];
		const char* g = s["group"] | "Sans groupe";

		// Cherche si le groupe existe déjà
		int gIdx = -1;
		for (uint16_t k = 0; k < groups.size(); ++k) {
		  if (groups[k].name == g) { gIdx = k; break; }
		}
		if (gIdx == -1) {                       // nouveau groupe
		  groups.push_back({ String(g), {} });
		  gIdx = groups.size() - 1;
		}
		groups[gIdx].idx.push_back(i);          // mémorise la position de l’écran
	  }

	  /************ 3. Affichage *******************************/
	  spr.fillSprite(TFT_BLACK);   // on efface le buffer hors-écran

	  const int GROUP_COL_X   = 5;           // colonne groupes
	  const int SCREEN_COL_X  = 140;         // colonne écrans
	  const int ITEM_H        = ITEM_HEIGHT;

	  /* colonne 1 : groupes */
	  maxGroup = groups.size();
	  for (uint16_t g = 0; g < groups.size(); ++g) {
		int y = g * ITEM_H + 30;

		if (g == currentGroup) {                         // groupe sélectionné
		  spr.fillRect(GROUP_COL_X-3, y, 130, ITEM_H+4, TFT_GREEN);
		  spr.setTextColor(0x9d14, TFT_GREEN);
		} else {
		  spr.setTextColor(0x9d14, TFT_BLACK);
		}
		spr.setCursor(GROUP_COL_X, y + ITEM_H/2 - 4);	
		spr.println(groups[g].name.c_str());
		//sprite_text(spr, groups[g].name.c_str(), GROUP_COL_X, y + ITEM_H/2 - 4);
	  }

	  /* colonne 2 : écrans du groupe sélectionné */
	  const GroupInfo& gSel = groups[currentGroup];
	  maxScreens=gSel.idx.size();
	  for (uint16_t k = 0; k < gSel.idx.size(); ++k) {
		JsonObject s = screens[gSel.idx[k]];
		const char* title = s["title"];

		int y = k * ITEM_H + 30;
		if (k == currentScreen && menu_focus==1) {                          // écran sélectionné
		  spr.fillRect(SCREEN_COL_X-3, y, LIST_WIDTH, ITEM_H+4, TFT_GREEN);
		  spr.setTextColor(0x9d14, TFT_GREEN);
		  selected_menu=gSel.idx[k];
		} else {
		  spr.setTextColor(0x9d14, TFT_BLACK);
		}
		spr.setCursor(SCREEN_COL_X, y + ITEM_H/2 - 4);	
		spr.println(title);
		//sprite_text(spr, title, SCREEN_COL_X, y + ITEM_H/2 - 4);
	  }
	  Serial.print("count open : ");
	  Serial.println(count_open);

	  //spr.pushSprite(0, 0);   // on transfère le buffer vers l’écran
	}
	
