	void draw_waveform_lfo(float wave[], float vol, float cutoff)
	{
		Serial.println("draw lfo");
		int borne=1024/5;
		Serial.println(borne);
		spr_wave.fillSprite(TFT_BLACK);
		//Serial.println(wave[100]);
		float size=105.0;
      for(int i=0; i<borne-1; i++)
      {
        int point1=size - (wave[i*5]*vol)*size-cutoff*size;
        int point2=size - (wave[i*5+3]*vol)*size-cutoff*size;
        if(point1<0) point1=0;
        if(point2<0) point2=0;
        if(point1>size) point1=size;
        if(point2>size) point2=size;
        if(i==0) point1=size/2;
        if(i==199) point2=size/2;
        int dist = point2-point1;
 
        if(size/2-point1>0) spr_wave.drawFastVLine(i+(249-borne)/2,point1 ,size/2-point1, TFT_DARKGREEN);
		if(size/2-point1<0) spr_wave.drawFastVLine(i+(249-borne)/2,size/2 ,point1-size/2, TFT_DARKGREEN);

        if(dist>0) {
          spr_wave.drawFastVLine(i+(249-borne)/2,point1 ,dist, TFT_GREEN);   
        }
        if(dist<0) {
          spr_wave.drawFastVLine(i+(249-borne)/2,point2 ,-dist, TFT_GREEN);
        }
        if(dist==0) spr_wave.drawFastVLine((249-borne)/2+i,point1 ,1, TFT_GREEN);
      }
      //tft.drawFastHLine(40, 120,200, TFT_GREEN);
      spr_wave.drawFastVLine((249-borne)/2, 0 , size, TFT_DARKGREY);
      spr_wave.drawFastVLine(125, 0 , size, TFT_DARKGREY);
      spr_wave.drawFastVLine(249-(249-borne)/2, 0 , size, TFT_DARKGREY);
	}
	
	
	
