	void draw_wave(int16_t *wavefile, int startind, int samplength, int sampstart, int sampend)
	{
		Serial.println("draw_wave");
		int borne=260;
		int indinc = samplength/borne;
		spr_wave.fillSprite(TFT_BLACK);
		spr_wave.fillRect(sampstart*borne/127, 0, borne-(sampend+sampstart)*borne/127, 120,  0x10e4);
      for(int i=0; i<borne; i++)
      {
        //int point1=32 - sine[i<<4]*28;
        //int point2=32 - sine[(i+1)<<4]*28;
        int point1=120 - *(wavefile+startind+(i*indinc))/512;
        int point2=120 - *(wavefile+startind+((i+1)*indinc))/512;
        if(i==0) point1=120;
        if(i==borne-2) point2=120;
        int dist = point2-point1;
        /*if(dist>0) tft.drawFastVLine(point1, 32+i,dist, TFT_WHITE);
        if(dist<0) tft.drawFastVLine(point2, 32+i,-dist, TFT_WHITE);
        if(dist==0) tft.drawFastVLine(point1, 32+i,1, TFT_WHITE);*/
        if(point1<120)
        {
          spr_wave.drawFastVLine(i,point1-60 ,120-point1, TFT_DARKGREEN);
        }
        else
        {
          spr_wave.drawFastVLine(i,60 ,point1-120, TFT_DARKGREEN);
        }
        if(dist>0) {
          spr_wave.drawFastVLine(i,point1-60 ,dist, TFT_GREEN);   
        }
        if(dist<0) {
          spr_wave.drawFastVLine(i,point2-60 ,-dist, TFT_GREEN);
          //tft.drawFastVLine(40+i,point1 ,110-point1, 0x00B0);
        }
        if(dist==0) spr_wave.drawFastVLine(i,point1-60 ,1, TFT_GREEN);
      }
      //tft.drawFastHLine(40, 120,200, TFT_GREEN);
	  //Serial.println(sampstart);
	  //Serial.println(borne);
      spr_wave.drawFastVLine(sampstart*borne/127, 0 , 120, TFT_RED);
      spr_wave.drawFastVLine(borne-sampend*borne/127, 0 , 120, TFT_RED);
	}
	
